import React from "react";

function LoginForm() {
  const nameEl = React.useRef(null);
  const DescriptionEl = React.useRef(null);
  const OrganisationEl = React.useRef(null);
  const ContactEl = React.useRef(null);
  const DateEl = React.useRef(null);
  const AddressEl = React.useRef(null);
  const GenderEl =  React.useRef(null);
  const CourseEl =  React.useRef(null);

  const handleSubmit = e => {
    e.preventDefault();
    const formData = {
      name: nameEl.current.value,
      Description: DescriptionEl.current.value,
      Organisation: OrganisationEl.current.value,
      Contact: ContactEl.current.value,
      Date: DateEl.current.value,
      Address: AddressEl.current.value,
      Gender: GenderEl.current.value,
      Course: CourseEl.current.value,
    };
    console.log(formData);
  };
  return (
    <div className="center">
      <h1>Meetup Form</h1>
      <form onSubmit={handleSubmit}>
        <label>
          {" "}
          Meetup Name: <input className="one" type="text" ref={nameEl} />
        </label>
        <br />
        <label>
          {" "}
          Meetup Description:
          <input className="two" type="text" ref={DescriptionEl} />
        </label>
        <br />
        <label>
          {" "}
          Meetup Organization:
          <input className="three" type="text" ref={OrganisationEl} />
        </label>
        <br />
        <label>
          {" "}
          Meetup Contact.No:
          <input className="four" type="text" ref={ContactEl} />
        </label>
        <br />
        <label> Meetup Date:</label>{" "}
        <input className="five" type="date" ref={DateEl} />
        <br />
        <label>
          {" "}
          Meetup Address:
          <input className="six" type="text" ref={AddressEl} />
        </label>
        <br />
        <label for="gender" className="six" >
          Meetup gender:
          <select id="gender" name="gender" ref={GenderEl}>
            <option value="Male">Male</option>
            <option value="Female" >Female</option>
          </select>
        </label><br />





       <label  >Course:
       <input type="radio" id="html" name="fav_language" value="HTML" rel={CourseEl} />
  <label >HTML</label><br />
  <input type="radio" id="css" name="fav_language" value="CSS" rel={CourseEl} />
  <label >CSS</label><br />
  <input type="radio" id="javascript" name="fav_language" value="JavaScript" rel={CourseEl} />
  <label>JavaScript</label>
        </label>
        <button className="button">Sumbit</button>
      </form>
    </div>
  );
}

export default LoginForm;
